// Create scales
var x = d3.scale.linear()
  .range([0, 2 * Math.PI]),

y = d3.scale.linear()
  .range([0, width/2]);

var x2 = d3.scale.linear()
  .range([0, 2 * Math.PI]),

y2 = d3.scale.linear()
  .range([0, width2/2]);

// Use d3.text and d3.csv.parseRows so that we do not need to have a header
// row, and can receive the csv as an array of arrays.
